import React , {Component} from "react";
import axios from "axios";

class Blog extends Component {
    state = {
        users: []
    }

    componentDidMount() {
        axios.get("https://jsonplaceholder.typicode.com/users")
        .then(result => {
            console.log(result.data)
            this.setState({
                users : result.data
            })
        })
    }



    render(){

        return(

            <div>
                <h1>Our Blog</h1>


                <div>
                    {this.state.users.map(users => 
                        <div>
                            <ul>
                                <li>Username</li>
                                <li>{users.name}</li>
                            </ul>
                        </div>)}
                </div>
            </div>

        )
    }
}

export default Blog;
